import logo from './logo.svg';
import './App.css';
import Styled from 'styled-components';


const Banner = Styled.div `
    display: flex;
    width: 100vw;
    height: 30rem;
    background: url('./racing.jpg');
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
`;

const Nav = Styled.div `
    display: flex;
    flex-direction: row;
    width: 100%;
    margin-bottom: 1rem;
    ul {
      li {
        list-style: none;
        display: inline;
        margin-left: 10rem;
      }
    }
`;

function App() {
  return (
    <div className="App">
      <header>

        <Nav>
        <NavMenu items={['Home','Fixtures','Podcasts', 'Players', 'About']} />
        </Nav>
        <Banner/>
        </header>
        <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
    </div>
  );
}

export default App;
